import { Navbar, NavbarBrand } from "reactstrap";

const NavBar = () => {
  return (
    <div>
      <Navbar>
        <NavbarBrand href="/">reactstrap</NavbarBrand>
      </Navbar>
    </div>
  );
};

export default NavBar;
